Man v. Cheetah

Science Documentary hosted by Scott Smith, published by National Geographic in 2013 - English narration


Information
------------------------------

Man v. Cheetah
Take nature's fastest land mammal vs. two of the quickest and most elusive athletes in all of professional sports: who wins ... and what shocking secrets are revealed? Nat Geo WILD gets a front row seat as the Tennessee Titans' Chris Johnson and the Chicago Bears' Devin Hester take part in an extraordinary first-ever one-on-one challenge against a cheetah. It's the race of a lifetime that has never been attempted before as cheetahs from Sea World's Busch Gardens race NFL's finest.

